import './App.css';
import React from 'react';
import { connect } from 'react-redux';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar';
import Services from './Components/Services';
import GalleryCarousel from './Components/GalleryCarousel';
import HowToFindUs from './Components/HowToFindUs';
import NewsCarousel from './Components/NewsCarousel';
import Authorization from './Components/Authorization';
import StaffMainMenu from './Components/StaffMainMenu';
import { GetImage } from './Redux/Actions/actions';

class App extends React.PureComponent {
  render() {
    function GetImage() {
      console.log('working');
      const requestURL = 'https://localhost:7275/MediaFile/GetFileById?id=1';

      var resp = fetch(requestURL)
        .then((response) => {
          if (!response.ok) {
            throw new Error(response.statusText);
          }
          return response;
        })
        .then(async (response) => {
          const data = await response.json();
        });

      return resp;
    }

    if (this.props.employeeToken === '') {
      return (
        <div className="App">
          <Header />
          <NavigationBar />
          <div className="main">
            <div className="main_window">
              <NewsCarousel />
              <GalleryCarousel />
              <Services />
              <HowToFindUs />
              <Authorization />
            </div>
          </div>
        </div>
      );
    } else {
      return (
        <div className="App">
          <Header />
          <NavigationBar />
          <div className="main">
            <div className="main_window">
              <StaffMainMenu />
            </div>
          </div>
        </div>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    employeeToken: state.employeeToken,
    responseDataList: state.responseDataList,
    activeMenu: state.activeMenu,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(App);
